   "source": [
    "## Data Exploration and Cleaning:\n",
    "\n",
    "The exploration part was not included in my original script. However, I vividly remember spending hours on EDA, pulling all kinds of graphs. As a replacement, I'll only plot a correlation plot instead for 1 year, to show how clearly some features are correlated.\n",
    "\n",
    "Furthermore, in this section I've written a cleaning function to keep the needed data: \n",
    "- I've kept only the regions that made it to the group stage of the respective World Championships that year\n",
    "- I've deleted the player-related columns (since we only analyse the team as a whole)\n",
    "> looking back, I could have used these player-based stats to analyse which roles are being focused on per region. This would also be an interesting deep dive."
   ]
